import React from 'react';

import styles from './../Style/Components/Content.module.css';

import Editor from './Editor';
import Messages from './Messages';

type MyProps = { Active: { Name: string, SID: string }, User: any };
type MyState = { };
class Content extends React.Component<MyProps, MyState> {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <section className={styles.Container}>
        <div className={styles.Top}>
          <picture className={styles.Icon}>
            <img 
              className={styles.Icon_IMG} 
              src={(`${process.env.Storage_Url}/Servers/${this.props.Active.SID}/Icon`)} 
            />
          </picture>
          <h2 className={styles.Head}>{this.props.Active.Name}</h2>
        </div>
        <Messages key={this.props.Active.SID} SID={this.props.Active.SID} User={this.props.User} />
        <div></div>
        <Editor SID={this.props.Active.SID} User={this.props.User} />
      </section>
    );
  }
}
export default Content;
